class TestSerializableDoc(unittest.TestCase):

    def test_serializableDoc_with_datetime(self):
        # Document containing a datetime field
        doc = {
            "name": "Sample Name",
            "created_at": datetime(2023, 1, 1, 12, 0, 0)
        }

        result = serializableDoc(doc)

        # Expected result with datetime serialized to ISO format
        expected = {
            "name": "Sample Name",
            "created_at": "2023-01-01T12:00:00"
        }

        self.assertEqual(result, expected)

    def test_serializableDoc_without_datetime(self):
        # Document without datetime fields
        doc = {
            "name": "Sample Name",
            "description": "Sample Description"
        }

        result = serializableDoc(doc)

        # Expected result should match input as there are no datetime fields
        expected = {
            "name": "Sample Name",
            "description": "Sample Description"
        }

        self.assertEqual(result, expected)

